On a cold and rainy summer night in June 1980, the Beach 
Boys played to a capacity crowd at a rock festival in England
a rocking, stomping show that got people up on their feet and 
brought a bit of California sunshine to the thousands of British 
fans who packed the show. An exceptional concert, which is one 
of the few from the era to feature all six Beach Boys - Mike, 
Carl, Dennis, Alan, Bruce and Brian - and a setlist that covers 
all the essential hits such as Good Vibrations, California Girls, 
I Get Around and Surfin' USA.
